import React, { useState } from 'react';

import Radio from '@material-ui/core/Radio';
import RadioGroup from '@material-ui/core/RadioGroup';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import FormControl from '@material-ui/core/FormControl';
import FormLabel from '@material-ui/core/FormLabel';
import BoxSelect from './BoxSelect'


import "./userSelect.css";

function UserSelect(props) {
  const [value, setValue] = useState('1');
  const handleChange = (event) =>
  {
    setValue(event.target.value);
  };
  return (
    <div className="userSelect">
    <FormControl component="fieldset">
      <RadioGroup className="radioButtonGroup" row aria-label="Semester" name="Semester" value={value} onChange={handleChange}>
        <FormControlLabel className="radioButton" value="1" control={<Radio size="large" />} label="Semester 1" />
        <FormControlLabel className="radioButton" value="2" control={<Radio size="large"/>} label="Semester 2" />
      </RadioGroup>
    </FormControl>

    <BoxSelect/>
    </div>
  );
}

export default UserSelect;
